import React from 'react';
import { Image } from 'react-native';
import { createBottomTabNavigator } from 'react-navigation-tabs';
import HomeScreen from './Home';
import ProfileScreen from './Profile';
import SettingsScreen from './Settings';
import HomeIcon from '../../assests/images/home.png';
import ProfileIcon from '../../assests/images/profile.png';
import SettingsIcon from '../../assests/images/settings.png';

const TabNavigator = createBottomTabNavigator(
  {
    Home: {
      screen: HomeScreen,
      navigationOptions: {
        tabBarLabel: 'Home',
        tabBarIcon: ({ tintColor }) => (
          <Image source={HomeIcon} style={{ height: 25, width: 25, tintColor }} />
        ),
      },
    },
    Profile: {
      screen: ProfileScreen,
      navigationOptions: {
        tabBarLabel: 'Profile',
        tabBarIcon: ({ tintColor }) => (
          <Image source={ProfileIcon} style={{ height: 25, width: 25, tintColor }} />
        ),
      },
    },
    Settings: {
      screen: SettingsScreen,
      navigationOptions: {
        tabBarLabel: 'Settings',
        tabBarIcon: ({ tintColor }) => (
          <Image source={SettingsIcon} style={{ height: 25, width: 25, tintColor }} />
        ),
      },
    },
  },
  {
    tabBarOptions: {
      activeTintColor: 'red',
      inactiveTintColor: 'gray',
    },
  }
);

export default TabNavigator;
